"""
Given a binary string s (a string consisting only of '0' and '1's).

Return the number of substrings with all characters 1's.

Since the answer may be too large, return it modulo 10^9 + 7.

 

Example 1:

Input: s = "0110111"
Output: 9
Explanation: There are 9 substring in total with only 1's characters.
"1" -> 5 times.
"11" -> 3 times.
"111" -> 1 time.
Example 2:

Input: s = "101"
Output: 2
Explanation: Substring "1" is shown 2 times in s.
Example 3:

Input: s = "111111"
Output: 21
Explanation: Each substring contains only 1's characters.
Example 4:

Input: s = "000"
Output: 0
 

Constraints:

s[i] == '0' or s[i] == '1'
1 <= s.length <= 10^5

3 1 + 2 + 3  = 6 
2 1 + 2 = 3

011001110

input:
""
output : 3200542526
expeted: 200542505
"""
from decimal import Decimal


class Solution:
    def numSub(self, s: str) -> int:
        final_count = 0
        number_of_continuous_ones = 0
        for i in range(len(s)):
            if s[i] == '1':
                number_of_continuous_ones += 1
            if s[i] == '0' or i == len(s) - 1:
                final_count += int(number_of_continuous_ones *
                                   (number_of_continuous_ones + 1) / 2)
                number_of_continuous_ones = 0

        return final_count

        # if final_count > 100000:
        #     '%.2E' % Decimal(final_count)

        # else:
        #     return final_count


test = Solution()
a = ""
print(test.numSub(a))
